import React from 'react'

const TabelaTokens = ({data, column}) => {
  return (
    <tbody>
        {data.map((item, index)=> <TableRow item={item}/>)}
    </tbody>
  )
}

const TableHeadItem = ({ item }) => <th>{item.heading}</th>
const TableRow = ({ item }) => {
    console.log("itens da tabela!!!!!: ", item);
    return <tr></tr>
}

export default TabelaTokens
